export function Menu({items} : { items: string[] }) {
  return (
    <ul className='Menu'>
      {items.map(item => (
        <li><button>{item}</button></li>
      ))}
      <li><button>cartoons</button></li>
      <li><button>films</button></li>
      <li><button>series</button></li>
    </ul>
  )
}
